import { Card } from "react-bootstrap";
import Link from "next/link";

const Folder = ({ title, options }) => {
  return (
    <Card className="folder-card">
      <div>{title}</div>
      <ul>
        {options.map((option) => (
          <Link>
            <a>
              <li>{option}</li>
            </a>
          </Link>
        ))}
      </ul>
    </Card>
  );
};

export default Folder;
